ALTER TABLE `favorite`
  ADD CONSTRAINT `RelationshipwithInstrumentAndFav` FOREIGN KEY (`Instrument_Name`) REFERENCES `instruments` (`Instrument_Name`) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT `RelationshipwithUserAndFav` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE ON UPDATE CASCADE;


ALTER TABLE `rent`
  ADD CONSTRAINT `RelationshipwithInstruments` FOREIGN KEY (`Instrument_Name`) REFERENCES `instruments` (`Instrument_Name`) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT `RelationshipwithUser` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE ON UPDATE CASCADE;


ALTER TABLE `stock`
  ADD CONSTRAINT `InstruAndStockRelation` FOREIGN KEY (`Instrument_Name`) REFERENCES `instruments` (`Instrument_Name`) ON DELETE CASCADE ON UPDATE CASCADE;

ALTER TABLE `user_ratings`
  ADD CONSTRAINT `RelationshipwithInstrumentAndRate` FOREIGN KEY (`Instrument_Name`) REFERENCES `instruments` (`Instrument_Name`) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT `RelationshipwithUserAndRate` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE ON UPDATE CASCADE;
